; /* Start:"a:4:{s:4:"full";s:51:"/local/templates/main_2021/js/map.js?16758012712447";s:6:"source";s:36:"/local/templates/main_2021/js/map.js";s:3:"min";s:0:"";s:3:"map";s:0:"";}"*/


const addresses = [
	{ lat: 46.398716, lng: 30.725958 },
	{ lat: 49.451402, lng: 27.012892 },
	{ lat: 50.506818, lng: 30.461850 }
];

var lang = $('html').attr('lang');

if(lang == "ru"){
	var address_text = ['65113, Украина, г. Одесса,<br> ул. Академика Глушко, 11-и<br> +38 (095) 373-04-03',
		'29000, Украина, г. Хмельницкий,<br> Староконстантиновское шоссе, 2/1Б<br> +38 (098) 824-21-01',
		'04082, Украина, г. Киев,<br> ул. Луговая, 1-а<br> +38 (096) 343-08-33'
	];
	}else if(lang == "ua"){
	var address_text = ['65113, Україна, м. Одеса,<br> вул. Академіка Глушка, 11-і<br> +38 (095) 373-04-03',
		'29000, Україна, м. Хмельницький,<br> Старокостянтинівське шосе, 2/1Б<br> +38 (098) 824-21-01',
		'04082, Україна, м. Київ,<br> вул. Лугова, 1-а<br> +38 (096) 343-08-33'
	];
}

let markers = [];

function initMap() {
	let f_center = new google.maps.LatLng({ lat: addresses[0].lat, lng: addresses[0].lng - 0.005 });
	
	
	const map = new google.maps.Map(document.getElementById("map"), {
		zoom: 15,
		mapTypeControl: false,
		//disableDefaultUI: true,
		center: f_center
	});
	const image = "/local/templates/main_2021/images/dot.png";
	for (let i = 0; i < addresses.length; i++) {
		
		const marker = new google.maps.Marker({
			position: addresses[i],
			map,
			icon: image,
			title: address_text[i],
			animation: google.maps.Animation.BOUNCE
		}) ;
		
		
		markers.push(
			marker
		);
		
		const infowindow = new google.maps.InfoWindow({
			content: address_text[i],
		});
		
		google.maps.event.addListener(marker, 'click', function() {
			
			
			
			infowindow.open({
				anchor: marker,
				map,
				shouldFocus: false,
			});
		});
		
		
	}
	
	
	
	
	
	
	
	// const cursorMarker = new google.maps.Marker({
	//   position: { lat: 46.398716, lng: 30.725958 },
	//   map,
	//   icon: image
	// });
	//cursorMarker.setAnimation(google.maps.Animation.BOUNCE);
	
	$('#map_list .list-item').click(function () {
		$('#map_list .list-item').removeClass('current');
		$(this).addClass('current');
		//console.log(f_center);
		myLatLng = new google.maps.LatLng({ lat: $(this).data('lat'), lng: $(this).data('lng') - 0.005 });
		map.panTo(myLatLng);
	});
}
/* End */
