; /* Start:"a:4:{s:4:"full";s:58:"/local/templates/main_2021/js/promo_test.js?16672545793374";s:6:"source";s:43:"/local/templates/main_2021/js/promo_test.js";s:3:"min";s:0:"";s:3:"map";s:0:"";}"*/
$(document).ready(function () {
    var canvas = document.getElementById('circle');

    if (canvas) {
        //console.log(canvas);
        var ctx = canvas.getContext('2d');
        var firstRun = true;
        initialize();

        function initialize() {
            // Register an event listener to call the resizeCanvas() function 
            // each time the window is resized.
            window.addEventListener('resize', resizeCanvas, false);
            // Draw canvas border for the first time.
            resizeCanvas();
        }
        function resizeCanvas() {
            var size = $(canvas).parent('.circle_wrapper').innerWidth();
            // if (size > $(window).height()) {
            //     size = $(window).height();
            //     console.log($(window).height());
            // }
            canvas.width = size;
            canvas.height = size;
            redraw(size);
            if (firstRun) {
                //moveDots(size);  
                setTimeout(function () {
                    moveDot(180, 200, '#dot_1', size, '', 0);
                    moveDot(180, 220, '#dot_2', size, '#promotext .text_1, #promotext .text_2, #promotext .text_3', 4);
                    moveDot(180, 240, '#dot_3', size, '', 8);
                }, 200);
                //console.log(1);
                firstRun = false;
            } else {
                movePoint(200, '#dot_1', size);
                movePoint(220, '#dot_2', size);
                movePoint(240, '#dot_3', size);
                //console.log(2);
            }

        }

        function redraw(size) {

            var width = size,
                height = size;
            var x = width,
                y = 0,
                radius = width - 6,
                angleStart = 0.5 * Math.PI,
                angleEnd = 1 * Math.PI;

            //Create gradient
            var gradient = ctx.createLinearGradient(0, 0, width, width);
            gradient.addColorStop(0, 'rgba(255,255,255, 0)');
            gradient.addColorStop(0.1, 'rgba(255,255,255, 0)');
            gradient.addColorStop(0.2, 'rgba(255,255,255, 1)');
            gradient.addColorStop(0.8, 'rgba(255,255,255, 1)');
            gradient.addColorStop(1, 'rgba(255,255,255, 0)');

            //Draw arc
            ctx.beginPath();
            ctx.arc(x, y, radius, angleStart, angleEnd);
            ctx.strokeStyle = gradient;
            ctx.lineWidth = 6;
            ctx.stroke();

        }
        function movePoint(angle, elem, size) {
            var x = size + (size - 6) * Math.cos(-angle * Math.PI / 180);
            var y = 0 + (size - 6) * Math.sin(-angle * Math.PI / 180);
            $(elem).css({ "top": y, "left": x });
        }
        function moveDot(start, angle, elem, size, pairEl, spedUp) {
            var i = start;
            var timerId = setInterval(function () {
                if (i <= angle) {
                    movePoint(i, elem, size); i = i + 0.2;
                } else {
                    clearInterval(timerId);
                    $(elem).addClass('inited');
                    $(pairEl).addClass('inited');
					if(pairEl){
						setTimeout(function(){
							$('.page_buttons.front-hide-button').removeClass('front-hide-button');
						}, 2000);
					
					}
					
					
                }
            }, 20 - spedUp);
        }
    }


});
